import fetch from 'isomorphic-unfetch'

import Layout from '../../layouts/default'

import TitleBanner from '../../components/TitleBanner'
import Listing from '../../components/Listing'

type JobsIndexProps = {
  title: string;
  body?: string;
  jobs?: [];
}

const JobsIndex = ({ jobs }: JobsIndexProps) => (
  <Layout>
    <h1>Homepage</h1>
    {
      jobs.map(({ id, attributes }, key) => 
        <Listing 
          type={`job`}
          id={id} 
          key={key}
        />
      )
    }
  </Layout>
)

JobsIndex.getInitialProps = async () => {
  const response = await fetch('http://127.0.0.1:8888/jsonapi/node/jobs/')
  const { data } = await response.json()

  return { jobs: data }
}

export default JobsIndex
